(function() {
    "use strict";

    angular
        .module("IamModule")
        .factory("IamService", ["$q", "$http", "SimpleWorkflowService", "EZCRCUtils", function($q, $http, simpleWorkflowService, ezcrcUtils) {

            var iamBaseUrl = "/states/service/iam";

            function parseRoleArn(arn) {
                var arnParts = arn.split("/");
                return {
                    name: arnParts[arnParts.length - 1],
                    arn: arn
                };
            }

            function loadRoles() {
                return $q(function(resolve, reject) {
                    simpleWorkflowService.loadLambdaRoles()
                        .success(function(data) {
                            var roleArns = angular.isArray(data) ? data.slice() : [];
                            resolve(roleArns.map(parseRoleArn));
                        })
                        .error(function() {
                            reject("ERROR_LOADING_IAM");
                        });
                });
            }

            function previewEZCRCRole(definition, type, loggingConfiguration) {
                if (!type) {
                    type = "STANDARD";
                }

                return $http
                    .post(iamBaseUrl + "/role/preview", {
                        definition: definition,
                        type: type,
                        loggingConfiguration: loggingConfiguration
                    })
                    .then(function(res) {
                        return res.data;
                    })
                    .catch(function(err) {
                        return $q.reject(err.data);
                    });
            }

            function createEZCRCRole(roleName, definition, checksum, type, loggingConfiguration) {
                if (!type) {
                    type = "STANDARD";
                }

                if (!ezcrcUtils.isValidRoleName(roleName)) {
                    return $q.reject({
                        errorCode: "EZCRC_ROLE_INVALID_NAME"
                    });
                }

                return $http
                    .post(iamBaseUrl + "/role/create", {
                        roleName: roleName,
                        definition: definition,
                        checksum: checksum,
                        type: type,
                        loggingConfiguration: loggingConfiguration
                    })
                    .then(function(res) {
                        return res.data;
                    })
                    .catch(function(errRes) {
                        return $q.reject(errRes.data);
                    });
            }

            return {
                parseRoleArn: parseRoleArn,
                getRoles: loadRoles,
                previewEZCRCRole: previewEZCRCRole,
                createEZCRCRole: createEZCRCRole
            };
        }
    ]);
})();
