                        CREATE_ROLE_ERROR_DETAILS.EZCRC_ROLE_FAILURE;
                        var header = translate(errorDetails.header, {
                            roleName: roleName
                        });
                        var message = translate(errorDetails.message, {
                            roleName: roleName
                        });
                        notificationsService.addErrorMessage(header, message);
