    function MapStateControlController($scope, $filter) {
        var self = this;
        var translate = $filter("translate");

        self.filteredMapIterations = [];
        self.selectedMapStatus = "any-status";
        self.mapStatuses = [
            {
                "label": translate("ANY_STATUS"),
                "id": "any-status"
            },
            {
                "label": translate("SUCCEEDED"),
                "id": "MapIterationSucceeded"
            },
            {
                "label": translate("FAILED"),
                "id": "MapIterationFailed"
            },
            {
                "label": translate("CANCELLED"),
                "id": "MapIterationAborted"
            },
            {
                "label": translate("IN_PROGRESS"),
                "id": "MapIterationStarted"
            },
            {
                "label": translate("PENDING"),
                "id": "pending"
            }
        ];

        self.onMapStatusChange = function() {
            self.filteredMapIterations = filterMapIterations(self.mapIterations, self.selectedMapStatus);
            self.selectedMapIndex = getInitialSelectedMapIndex(self.filteredMapIterations);
            updateSelectedMapIterations(self.selectedMapIndex);
        };

        self.onMapIndexChange = function() {
            updateSelectedMapIterations(self.selectedMapIndex);
        };

        self.isMapIterationPresent = function() {
            return self.filteredMapIterations.length > 0;
        };

        self.getFirstIndex = function() {
            self.selectedMapIndex = self.filteredMapIterations[0].id;
            self.onMapIndexChange();
        };

        self.getLastIndex = function() {
            self.selectedMapIndex = self.filteredMapIterations[self.filteredMapIterations.length - 1].id;
            self.onMapIndexChange();
        };

        self.getNextIndex = function() {
            var index = findIndex(self.filteredMapIterations, self.selectedMapIndex);
            var nextIndex = index + 1;
            if (0 <= nextIndex && nextIndex < self.filteredMapIterations.length) {
                self.selectedMapIndex = self.filteredMapIterations[nextIndex].id;
                self.onMapIndexChange();
            }
        };

        self.getPreviousIndex = function() {
            var index = findIndex(self.filteredMapIterations, self.selectedMapIndex);
            var previousIndex = index - 1;
            if (0 <= previousIndex && previousIndex < self.filteredMapIterations.length) {
                self.selectedMapIndex = self.filteredMapIterations[previousIndex].id;
                self.onMapIndexChange();
            }
        };

        function findIndex(mapIterations, selectedMapIndex) {
            for (var index = 0; index < mapIterations.length; index++) {
                if (mapIterations[index].id === selectedMapIndex) {
                    return index;
                }
            }
            return -1;
        }

        function updateSelectedMapIterations(selectedIndex) {
            self.onIterationIndexSelected({ selectedIndex: selectedIndex });
        }

        function filterMapIterations(mapIterations, status) {
            return status !== "any-status" ?
                mapIterations.filter(function(mapIndexOption) { return mapIndexOption.status === status; }) : mapIterations;
        }

        function getInitialSelectedMapIndex(mapIterations) {
            var mapIndexIds = mapIterations.map(function(mapIndexOption) {
                return mapIndexOption.id;
            });
            if (mapIndexIds.length === 0 || mapIndexIds.indexOf(self.selectedMapIndex) !== -1) {
                return self.selectedMapIndex;
            } else {
                return mapIndexIds[0];
            }
        }

        function refreshMapStateControl() {
            self.selectedMapIndex = self.mapIndex;
            self.selectedMapStatus = "any-status";
            self.filteredMapIterations = self.mapIterations;
        }

        $scope.$watchCollection("$ctrl.mapIterations", refreshMapStateControl);
    }

